<div class="entities" style="line-height: 2.5; direction: ltr">Dopamine agonist-induced hypothermia and disruption of prepulse inhibition : evidence for a role of D3 receptors ? The dopamine D3 / D2 receptor agonists 7 - OH-DPAT , quinpirole , quinelorane , and PD128907 , the mixed dopamine agonist apomorphine , the D2 agonist bromocriptine , and the D1 / D5 agonist SKF 38393 were examined in models of hypothermia and prepulse inhibition ( PPI ) in Wistar rats . As dopamine agonist-induced hypothermia has been proposed as a model of D3 receptor function , and dopamine agonists are known to disrupt PPI , drug potencies to induce hypothermia were established and compared with doses necessary to disrupt PPI . 7 - OH-DPAT , quinpirole , quinelorane , PD128907 , and apomorphine , reduced body temperature and disrupted PPI with a similar rank order of potency ( quinelorane &gt; quinpirole = 7 - OH-DPAT &gt; PD128907 = apomorphine ) . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and SKF 38393 were ineffective in both models . In a separate study , the dopamine reuptake inhibitors cocaine and GBR 12909 had no effect on PPI . In a final set of studies , the D2 / D3 antagonist raclopride blocked both 7 - OH-DPAT-induced hypothermia and 7 - OH-DPAT-induced PPI disruption . The 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P08908

</mark>

<div class="entities" style="line-height: 2.5; direction: ltr">Control of phenylalanine and tyrosine metabolism by phosphorylation mechanisms . A system for the parallel determination of enzyme phosphorylation and expressed activity in rat liver cells , and its application to studies of phenylalanine hydroxylase and tyrosine aminotransferase , is described . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 hydroxylase is phosphorylated by agents which stimulate cyclic AMP - and Ca2 + - dependent protein kinase activity . The phosphorylation site ( s ) appear to be the same for both kinases . Phosphorylation is accompanied by increased metabolic flux at low , physiologically relevant , substrate concentrations . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and spermine both inhibit the phosphorylation of the enzyme , possibly by increasing dephosphorylation . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is phosphorylated in liver cell incubations but the rate is slow and insensitive to additions to the medium . No parallel changes in flux could be detected . Both enzymes are subject to complex regulatory mechanisms , short - and long-term . Their activities may be coordinated in vivo by control exerted at the level of the plasma membrane where both amino acids share the same transport processes . Determination of the control coefficients for the several components indicates that membrane transport may be a major limitation on flux .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Prospection of genomic regions divergently selected in racing line of Quarter Horses in relation to cutting line . Selection of Quarter Horses for different purposes has led to the formation of lines , including racing and cutting horses . The objective of this study was to identify genomic regions divergently selected in racing line of Quarter Horses in relation to cutting line applying relative extended haplotype homozygosity ( REHH ) analysis , an extension of extended haplotype homozygosity ( EHH ) analysis , and the fixation index ( F ST ) statistic . A total of 188 horses of both sexes , born between 1985 and 2009 and registered at the Brazilian Association of Quarter Horse Breeders , including 120 of the racing line and 68 of the cutting line , were genotyped using single nucleotide polymorphism arrays . On the basis of 27 genomic regions identified as selection signatures by REHH and F ST statistics , functional annotations of genes were made in order to identify those that could have been important during formation of the racing line and that could be used subsequently for the development of selection tools . Genes involved in muscle growth ( n = 8 ) , skeletal growth ( n = 10 ) , muscle energy metabolism ( n = 15 ) , cardiovascular system ( n = 14 ) and nervous system ( n = 23 ) were identified , including the O75072 ,

<h2 style="margin: 0">21</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Protease inhibitors prevent plasminogen-mediated , but not pemphigus vulgaris-induced , acantholysis in human epidermis . Pemphigus is an autoimmune blistering disease of the skin and mucous membranes . It is caused by autoantibodies directed against desmosomes , which are the principal adhesion structures between epidermal keratinocytes . Binding of autoantibodies leads to the destruction of desmosomes resulting in the loss of cell-cell adhesion ( acantholysis ) and epidermal blisters . The plasminogen activator system has been implicated as a proteolytic effector in pemphigus . We have tested inhibitors of the plasminogen activator system with regard to their potential to prevent pemphigus-induced cutaneous pathology . In a human split skin culture system , IgG preparations of sera from pemphigus vulgaris patients caused histopathologic changes ( acantholysis ) similar to those observed in the original pemphigus disease . All inhibitors that were tested ( active site inhibitors directed against uPA , tPA , and / or plasmin ; antibodies neutralizing the enzymatic activity of uPA or tPA ; substances interfering with the binding of uPA to its specific cell surface receptor 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) failed to prevent pemphigus vulgaris IgG-mediated acantholysis .

</mark>
 - mediated acantholysis , however , was effectively antagonized by the synthetic active site serine protease inhibitor 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 or by p-aminomethylbenzoic acid . Our data argue against applying anti-plasminogen activator / anti-plasmin strategies in the management of pemphigus .</div>

<h2 style="margin: 0">22</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is dispensable for oxygen sensing in vivo . Prolyl - 4 - hydroxylation is necessary for proper structural assembly of collagens and oxygen-dependent protein stability of hypoxia-inducible transcription factors ( HIFs ) . In vitro function of HIF prolyl - 4 - hydroxylase domain ( P20941 ) enzymes requires oxygen and 2 - oxoglutarate as cosubstrates with iron ( II ) and vitamin C serving as cofactors . Although vitamin C deficiency is known to cause the collagen-disassembly disease scurvy , it is unclear whether cellular oxygen sensing is similarly affected . Here , we report that vitamin C-deprived Gulo ( - / - ) knockout mice show normal HIF-dependent gene expression . The systemic response of Gulo ( - / - ) animals to inspiratory hypoxia , as measured by plasma erythropoietin levels , was similar to that of animals supplemented with vitamin C . Hypoxic HIF induction was also essentially normal under serum - and vitamin C-free cell-culture conditions , suggesting that vitamin C is not required for oxygen sensing in vivo . Glutathione was found to fully substitute for vitamin C requirement of all 3 P20941 isoforms in vitro . Consistently , glutathione also reduced HIF - 1α protein levels , transactivation activity , and endogenous target gene expression in cells exposed to CoCl ( 2 ) . A Cys 201Ser mutation in Q9GZT9 increased basal hydroxylation rates and conferred resistance to oxidative damage in vitro , suggesting that this surface-accessible Q9GZT9 cysteine residue is a target of antioxidative protection by vitamin C and glutathione .</div>
